import React from "react";

import classes from "./AllMyFriendsInfo.module.css";

const AllFriendsInfo = () => {
  return (
    <div className={classes.friendsinfo}>
      <h1>All friends</h1>
    </div>
  );
};

export default AllFriendsInfo;
